import { cardStyles } from "../boardStyles";

function Card() {
  return (
    <div style={cardStyles.container}>
      <span>
        <h1> A Card</h1>
        <p>Date</p>
      </span>
      <hr />
      <p>Description and informationt that is kept within the card</p>
    </div>
  );
}

export default Card;
